#! /bin/bash
if [ "$1" == "customer-login" ]; then
    customer_url=$(minikube service customer-node-service --url -n grocery)
    curl --header "Content-Type: application/json" --request POST --data '{"email":"test4@test.com",  "password":"12345"}' "$customer_url/login"
fi

if [ "$1" == "customer-signup" ]; then
    customer_url=$(minikube service customer-node-service --url -n grocery)
    curl --header "Content-Type: application/json" --request POST --data '{ "email":"test4@test.com",  "password":"12345", "phone":"12345"}' "$customer_url/signup"
fi

if [ "$1" == "create-product" ]; then
    product_url=$(minikube service product-node-service --url -n grocery)
    curl --header "Content-Type: application/json" --request POST --data '{"name":"Broccoli","desc":"great Quality of Broccoli","type":"VEGETABLE", "banner":"data:image/jpeg;base64,","unit":2,"price":320,"available":true,"supplier":"Golden seed firming"}' "$product_url/product/create"
curl --header "Content-Type: application/json" --request POST --data '{"name":"Orange","desc":"great Quality of Orange","type":"Fruits", "banner":"data:image/jpeg;base64,","unit":5,"price":300,"available":true,"supplier":"Golden seed firming"}' "$product_url/product/create"
curl --header "Content-Type: application/json" --request POST --data '{"name":"Oil","desc":"great Quality of Oil in France ","type":"Oils", "banner":"data:image/png;base64,","unit":20,"price":30,"available":true,"supplier":"Efrei Oil"}' "$product_url/product/create"

fi
